// REturn Arrow component 
export default function REturnArroW() {

 React.useEffect(() => {
  TweenMax.from('.wrp-arrow-profil',)
 }, [])

 return (
  <div className='wrp-arrow-profil'>
   <HiArrowLeft size={'1.8em'} color='#fff' />
   <div></div>
  </div>
 );
};
